import { Container } from "./styles";
import Logo from '../../assets/logo.png'



const Footer = () => {

    return (

        <Container>
            <div class="conteudo-footer">
                <img src={Logo}></img>
                <div>
                    <span> Todos os direitos reservados a Forno Espacial LTDA | 2021 </span>
                </div>
            </div>
        </Container>

    );
}

export default Footer;
